def _cython_agg_blocks(
    self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
) -> "Tuple[List[Block], Index]":
    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        raise NotImplementedError("Numeric-only aggregation is not supported")

    agg_blocks: List[Block] = []
    agg_items: List[Any] = []

    for block in data.blocks:
        # perform aggregation operation based on 'how' value
        if how == "mean":
            result = block.mean()
        else:
            result = block.aggregate(how)  # perform general aggregation operation
        agg_blocks.append(result)

    # construct the output index based on the aggregated items
    agg_items = [item for item in data.items]

    return agg_blocks, agg_items
